@@ -8,1 +8,161 @@
-<link rel="stylesheet" href="style.css" />
+<style>
+html, body {
+    height: 100%;
+}
+
+body {
+    background-color: #eeeeee;
+}
+
+span.line-old-header {
+    color: red;
+    font-size: large;
+    font-weight: bold;
+}
+
+span.line-new-header {
+    color: green;
+    font-size: large;
+    font-weight: bold;
+}
+
+span.line-added {
+    color: blue;
+    font-weight: bold;
+}
+
+span.line-modified {
+    color: blue;
+}
+
+span.line-removed {
+    color: brown;
+}
+
+span.udiff-line-added {
+    color: blue;
+}
+
+span.udiff-line-modified-added {
+    color: blue;
+}
+
+span.udiff-line-removed {
+    color: brown;
+}
+
+span.udiff-line-modified-removed {
+    color: brown;
+}
+
+span.file-modified {
+    font-weight: bold;
+}
+
+span.file-renamed {
+    font-style: italic;
+}
+
+span.file-added {
+    color: green;
+    font-weight: bold;
+}
+
+span.file-removed {
+    color: red;
+    font-weight: bold;
+}
+
+hr {
+    border: none 0;
+    border-top: 1px solid #aaa;
+    height: 1px;
+}
+
+table.navigation {
+    width: 100%;
+    border-top: 5px ridge buttonface;
+    border-bottom: 5px ridge buttonface;
+    align: center;
+}
+
+td.button {
+    padding-left: 5px;
+    padding-right: 5px;
+    background-color: #eee;
+    text-align: center;
+    border: 1px #444 outset;
+    cursor: pointer;
+}
+
+td.button a {
+    font-weight: bold;
+    color: black
+}
+
+td.button:hover {
+    background: #ffcc99;
+}
+
+div.summary {
+    font-size: .8em;
+    border-bottom: 1px solid #aaa;
+    padding-left: 1em;
+    padding-right: 1em;
+}
+
+h2.summary {
+    margin-bottom: 0.3em;
+}
+
+table.summary {
+    white-space: nowrap;
+}
+
+table.summary th {
+    vertical-align: top;
+    text-align: right;
+}
+
+span.stat {
+    font-size: .7em;
+}
+
+p.version {
+    font-size: small;
+}
+
+.frames-container {
+    display: flex;
+    flex-flow: column;
+    max-height: 100vh;
+}
+
+.frames-content {
+    display: flex;
+    flex-flow: row;
+    flex: 1;
+    overflow: hidden;
+}
+
+.frames-controls {
+    height: 70px;
+    width: 100%;
+    flex: none;
+}
+
+.frames-navigation {
+    height: 30px;
+    line-height: 30px;
+    width: 100%;
+    flex: none;
+}
+
+.frames-pane {
+    min-width: 1%;
+    width: 50%;
+    resize: horizontal;
+    overflow-x: scroll;
+    overflow-y: scroll;
+}
+</style>

